import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../../hooks/useAuth';
import LoadingSpinner from '../common/LoadingSpinner';
import ErrorMessage from '../common/ErrorMessage';

const Register = () => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        password: '',
        confirmPassword: ''
    });
    const [isLoading, setIsLoading] = useState(false);
    const [successMessage, setSuccessMessage] = useState('');
    const { register, error, clearError } = useAuth();

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
        clearError();
        setSuccessMessage('');
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        if (formData.password !== formData.confirmPassword) {
            console.error('‚ùå Password mismatch');
            return;
        }

        setIsLoading(true);
        setSuccessMessage('');
        clearError();

        console.log('üöÄ Registration attempt started for:', formData.email);

        try {
            await register(formData.email, formData.password, formData.name);
            console.log('‚úÖ Registration successful for:', formData.email);
            setSuccessMessage('Account created successfully! Redirecting...');
            
            // Clear form
            setFormData({
                name: '',
                email: '',
                password: '',
                confirmPassword: ''
            });
        } catch (error) {
            console.error('‚ùå Registration error:', {
                code: error.code,
                message: error.message,
                email: formData.email
            });
            
            // Error is already set in AuthContext, just log it here
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <div className="auth-page">
            <div className="auth-container">
                <div className="auth-header">
                    <h1>Join MoodMate</h1>
                    <p>Start your journey to better mental wellness</p>
                </div>

                <form className="auth-form" onSubmit={handleSubmit}>
                    <h2>Create Account</h2>

                    {error && <ErrorMessage error={error} onDismiss={clearError} />}
                    
                    {successMessage && (
                        <div className="success-message" style={{
                            backgroundColor: '#d4edda',
                            color: '#155724',
                            padding: '10px',
                            borderRadius: '4px',
                            marginBottom: '15px',
                            border: '1px solid #c3e6cb'
                        }}>
                            {successMessage}
                        </div>
                    )}

                    <div className="form-group">
                        <label htmlFor="name">Full Name</label>
                        <input
                            type="text"
                            id="name"
                            name="name"
                            value={formData.name}
                            onChange={handleChange}
                            required
                            placeholder="Enter your full name"
                            disabled={isLoading}
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="email">Email</label>
                        <input
                            type="email"
                            id="email"
                            name="email"
                            value={formData.email}
                            onChange={handleChange}
                            required
                            placeholder="Enter your email"
                            disabled={isLoading}
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="password">Password</label>
                        <input
                            type="password"
                            id="password"
                            name="password"
                            value={formData.password}
                            onChange={handleChange}
                            required
                            placeholder="Enter your password"
                            disabled={isLoading}
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="confirmPassword">Confirm Password</label>
                        <input
                            type="password"
                            id="confirmPassword"
                            name="confirmPassword"
                            value={formData.confirmPassword}
                            onChange={handleChange}
                            required
                            placeholder="Confirm your password"
                            disabled={isLoading}
                        />
                    </div>

                    {formData.password !== formData.confirmPassword && formData.confirmPassword && (
                        <p className="error-text">Passwords do not match</p>
                    )}

                    <button
                        type="submit"
                        className="auth-button"
                        disabled={isLoading || formData.password !== formData.confirmPassword}
                    >
                        {isLoading ? <LoadingSpinner size="small" /> : 'Create Account'}
                    </button>

                    <div className="auth-footer">
                        <p>
                            Already have an account? <Link to="/login">Sign in</Link>
                        </p>
                    </div>
                </form>
            </div>
        </div>
    );
};

export default Register;
